#get the name of the index persist variable for referring to the holo object in expression 2
def getPersistHoloIndexVariableName(holoObjectBlenderName):
    return holoObjectBlenderName.replace("_","").replace(".","").upper() + "Index"

#get blender object E2 equivalent rotation string
def getHoloRotationString(holoObject):
    #to match Gmod's coordinate system as implemented by the Expression 2:
    #using the Blender 'interface' version of the local euler rotation for the object rotated by 90 degrees on Z, then:
    #Blender +X maps to Gmod +Z
    #Blender +Y maps to Gmod +X
    #Blender +Z maps to Gmod +Y
    eulerRotation = holoObject.matrix_world.to_euler() #get the object world euler rotation
    eulerRotation.rotate_axis("Z",math.radians(90))
    return "ang(" + str(round(math.degrees(eulerRotation[1]),3)) + "," + str(round(math.degrees(eulerRotation[2]),3)) + "," + str(round(math.degrees(eulerRotation[0]),3)) + ")"

#get blender object E2 equivalent location string
def getHoloLocationString(holoObject):
    return "vec(" + str(round(holoObject.matrix_world.translation[0],3)) + "," + str(round(holoObject.matrix_world.translation[1],3)) + "," + str(round(holoObject.matrix_world.translation[2],3)) + ")"

#get blender object E2 equivalent scale string
def getHoloScaleString(holoObject):
    #scale mapping:
    #Blender +X maps to Gmod +Y
    #Blender +Y maps to Gmod +X
    #Blender +Z maps to Gmod +Z
    return "vec(" + str(round(holoObject.matrix_world.to_scale()[1],3)) + "," + str(round(holoObject.matrix_world.to_scale()[0],3)) + "," + str(round(holoObject.matrix_world.to_scale()[2],3)) + ")"
#get blender object E2 equivalent color string
def getHoloColorString(holoObject):
    holoObjectMaterialColor = holoObject.material_slots[0].material.node_tree.nodes["RGB"].outputs["Color"].default_value
    colorMultiplier = 255
    return "vec(" + str(round(holoObjectMaterialColor[0]*colorMultiplier,3)) + "," + str(round(holoObjectMaterialColor[1]*colorMultiplier,3)) + "," + str(round(holoObjectMaterialColor[2]*colorMultiplier,3)) + ")"

#generate text file for use in Expression2
def generateFile(operator):
    holoObjectsList = []
    data = "@persist ["
    #add persistent holo index number variables
    for potentialBlenderHoloObject in bpy.context.scene.objects:
        if("E2HoloMeshType" in potentialBlenderHoloObject):
            if(potentialBlenderHoloObject["E2HoloMeshType"] != "sizereference"):
                holoObjectsList.append(potentialBlenderHoloObject)
                data += getPersistHoloIndexVariableName(potentialBlenderHoloObject.name) + " "
    #remove last space from part names list and close, specifying that each is a number variable
    data = data[:-1]
    data += "]:number\n"
    #add batch holo shape load iteration variable and animation frame variables
    data += "@persist [HoloLoadIteration]:number [HoloCurrentFrameNumber]:number [HoloTotalFrames]:number\n\n"
    #add functions for local position and rotation
    data += (
    "#rotate a hologram (done in world space) using the rotation coordinates of the parent\n"
    "function holoRotateRelativeToParent(IndexOfHolo:number,HoloParentEntity:entity,NewRotation:angle) {\n"
    "    holoAng(IndexOfHolo,HoloParentEntity:toWorld(NewRotation))\n"
    "}\n\n"
    "#position a hologram (done in world space) added to the position coordinates of the parent\n"
    "function holoPositionRelativeToParent(IndexOfHolo:number,HoloParentEntity:entity,NewPosition:vector) {\n"
    "    holoPos(IndexOfHolo,HoloParentEntity:toWorld(NewPosition))\n"
    "}\n\n"
    "#function to create and color holo components relative to a parent object, returning the index number of the created holo\n"
    "function number holoRelativeToObject(RelativeObject:entity,Offsetpos:vector,Holosize:vector,Holorotation:angle,Holocolor:vector,Holomodel:string,HoloMaterialName:string) {\n"
    "    ThisHoloIndex=holoAmount()+1\n"
    "    holoCreate(ThisHoloIndex,RelativeObject:pos(),Holosize,Holorotation,Holocolor,Holomodel)\n"
    "    holoParent(ThisHoloIndex,RelativeObject)\n"
    "    #set position and rotation relative to parent\n"
    "    holoPositionRelativeToParent(ThisHoloIndex,RelativeObject,Offsetpos)\n"
    "    holoRotateRelativeToParent(ThisHoloIndex,RelativeObject,Holorotation)\n"
    "    #set material for holo\n"
    "    holoMaterial(ThisHoloIndex,HoloMaterialName)\n"
    "    return ThisHoloIndex\n"
    "}\n\n"
    "#run when E2 is first created\n"
    "if(first()|dupefinished()){\n"
    "    HoloLoadIteration=0\n"
    "    HoloCurrentFrameNumber=0\n"
    )
    data += "    HoloTotalFrames=" + str(bpy.context.scene.frame_end) + "\n"
    data += (
    "    timer(\"stepLoadHoloShapes\",350)\n"
    "}\n\n"
    "if( clk(\"stepLoadHoloShapes\") ) {\n"
    "    switch(HoloLoadIteration){\n"
    "        case(0),\n"
    )
    #load in holo objects in batches with a tick delay
    tickLoadedObjectsCount = 0
    totalBatchesCount = 0
    holoParentEntityString = "entity()"
    for blenderHoloObject in holoObjectsList:
        holoObjectPositionString = getHoloLocationString(blenderHoloObject)
        holoObjectRotationString = getHoloRotationString(blenderHoloObject)
        holoObjectScaleString = getHoloScaleString(blenderHoloObject)
        holoObjectColorString = getHoloColorString(blenderHoloObject)
        data += "            " + getPersistHoloIndexVariableName(blenderHoloObject.name) + " = holoRelativeToObject(" + holoParentEntityString + "," + holoObjectPositionString + "," + holoObjectScaleString + "," + holoObjectRotationString + "," + holoObjectColorString + ",\"" + blenderHoloObject["E2HoloMeshType"] + "\",\"" + blenderHoloObject["E2HoloMaterialName"] + "\")\n"
        tickLoadedObjectsCount += 1
        if(tickLoadedObjectsCount > 1 and tickLoadedObjectsCount < len(holoObjectsList)):
            totalBatchesCount += 1
            data += (
            "            timer(\"stepLoadHoloShapes\",350)\n"
            "            break\n"
            )
            data += "        case(" + str(totalBatchesCount) + "),\n"
            tickLoadedObjectsCount = 0
    data += (
    "            timer(\"stepHoloAnimation\",40)\n"
    "            break\n"
    "    }\n"
    "    HoloLoadIteration=HoloLoadIteration+1\n"
    "}\n\n"
    )
    #set up animation loop if available
    frameSwitchCreated = False
    frameCaseStrings = {}
    frameHasKeyframes = False
    for frameNumber in range(bpy.context.scene.frame_start,bpy.context.scene.frame_end+1):
        frameHasKeyframes = False
        bpy.context.scene.frame_set(frameNumber)
        for blenderHoloObject in holoObjectsList:
            #record everything on frame 1
            if (frameNumber == bpy.context.scene.frame_start):
                blenderHoloObject["E2PreviousPositionString"] = "None"
                blenderHoloObject["E2PreviousRotationString"] = "None"
                blenderHoloObject["E2PreviousScaleString"] = "None"
                blenderHoloObject["E2PreviousColorString"] = "None"
            
            holoObjectPositionString = getHoloLocationString(blenderHoloObject)
            holoObjectRotationString = getHoloRotationString(blenderHoloObject)
            holoObjectScaleString = getHoloScaleString(blenderHoloObject)
            holoObjectColorString = getHoloColorString(blenderHoloObject)
            
            #determine if a keyframe should be recorded in E2 script at all
            if(holoObjectPositionString != blenderHoloObject["E2PreviousPositionString"] or
                holoObjectRotationString != blenderHoloObject["E2PreviousRotationString"] or
                holoObjectScaleString != blenderHoloObject["E2PreviousScaleString"] or
                holoObjectColorString != blenderHoloObject["E2PreviousColorString"]):
                    frameHasKeyframes = True
            
            if(frameHasKeyframes == True):
                #make animation frame switch statement if it doesn't exist
                if(frameSwitchCreated == False):
                    data += (
                    "if( clk(\"stepHoloAnimation\") ) {\n"
                    "    switch(HoloCurrentFrameNumber){\n"
                    )
                    frameSwitchCreated = True
                
                #make switch case for this frame
                if((str(frameNumber) in frameCaseStrings) == False):
                    frameCaseStrings[str(frameNumber)] = "            case(" + str(frameNumber) + "),\n"
                
                #only create E2 lines for differences
                if(holoObjectPositionString != blenderHoloObject["E2PreviousPositionString"]):
                    frameCaseStrings[str(frameNumber)] += "                holoPositionRelativeToParent(" + getPersistHoloIndexVariableName(blenderHoloObject.name) + "," + holoParentEntityString + "," + holoObjectPositionString + ")\n"
                if(holoObjectRotationString != blenderHoloObject["E2PreviousRotationString"]):
                    frameCaseStrings[str(frameNumber)] += "                holoRotateRelativeToParent(" + getPersistHoloIndexVariableName(blenderHoloObject.name) + "," + holoParentEntityString + "," + holoObjectRotationString + ")\n"
                if(holoObjectScaleString != blenderHoloObject["E2PreviousScaleString"]):
                    frameCaseStrings[str(frameNumber)] += "                holoScale(" + getPersistHoloIndexVariableName(blenderHoloObject.name) + "," + holoObjectScaleString + ")\n"
                
                #update record of differences for object
                blenderHoloObject["E2PreviousPositionString"] = holoObjectPositionString
                blenderHoloObject["E2PreviousRotationString"] = holoObjectRotationString
                blenderHoloObject["E2PreviousScaleString"] = holoObjectScaleString
                blenderHoloObject["E2PreviousColorString"] = holoObjectColorString
                
                

    #add sound emit events from timeline markers
    for holoMarker in bpy.context.scene.timeline_markers:
        emitObjectAndSound = holoMarker.name.split(",")
        if(len(emitObjectAndSound) == 2):
           frameCaseStrings[str(int(holoMarker.frame))] += "                holoEntity(" + getPersistHoloIndexVariableName(emitObjectAndSound[0]) + "):soundPlay(1,1,\"" + emitObjectAndSound[1] + "\")\n"
           frameCaseStrings[str(int(holoMarker.frame))] += "                soundVolume(1,0.5)\n" 
    if(frameSwitchCreated == True):
        for frameCaseStringKey in frameCaseStrings.keys():
            data += frameCaseStrings[frameCaseStringKey] + "            break\n"
        data += (
        "    }\n"
        "    HoloCurrentFrameNumber=HoloCurrentFrameNumber+1\n"
        "    if( HoloCurrentFrameNumber > HoloTotalFrames ) {\n"
        "        HoloCurrentFrameNumber=0\n"
        "    }\n"
        "    timer(\"stepHoloAnimation\",60)\n"
        "}\n"
        )
    file = open(operator.filepath, "w")
    file.write(data)
    file.close()
    operator.report({'INFO'},"Generated E2 script containing " + str(len(holoObjectsList)) + " holos")


class BLENDTOHOLO_OT_ExportExpression2(bpy.types.Operator, ExportHelper):
    """Export scene as Expression 2 Hologram script for Garry's Mod"""
    bl_idname = "e2holo.export"
    bl_label = "Export E2 Holo Script"
    filename_ext = ".txt"
    filter_glob = bpy.props.StringProperty(
            default="*.txt",
            options={'HIDDEN'},
            )
    filepath = bpy.props.StringProperty(subtype="FILE_PATH")
    def execute(self, context):
        generateFile(self)
        return {'FINISHED'}
    def invoke(self, context, event):
        context.window_manager.fileselect_add(self)
        return {'RUNNING_MODAL'}
    

class BLENDTOHOLO_OT_AddSoundMarker(bpy.types.Operator):
    bl_idname = "e2holo.addsoundmarker"
    bl_label = "Add E2 Sound Marker"
    bl_description = "Add a marker to trigger a Garry's Mod sound to play from a holo object"
    
    soundName: bpy.props.StringProperty(name="soundPathString",description="Garry's Mod sound name to be played from the selected object at the current frame",default="garrysmod/balloon_pop_cute.wav")
    
    def execute(self, context):
        soundPathName = self.soundName
        if(bpy.context.active_object != None):
            if(("E2HoloMeshType" in bpy.context.active_object) == False):
                self.report({'WARNING'},"The active object has no E2 holo data. Please choose one with E2 holo data to play this sound from")
            else:
                bpy.context.scene.timeline_markers.new(name=bpy.context.active_object.name + "," + soundPathName, frame=bpy.context.scene.frame_current)
                self.report({'INFO'},"Created E2 Holo play sound marker at frame " + str(bpy.context.scene.frame_current) + " for holo object " + bpy.context.active_object.name)
        else:
            self.report({'WARNING'},"Please select an object with E2 holo data to play this sound from")
        return {"FINISHED"}
    


